package ejopackage.helper;

import java.util.List;

public class Combinationcomplete {
	private int id;
    private String name;
    private String description;
    private List<Levelcomplete> combinationlevels;
	public Combinationcomplete() {
		// TODO Auto-generated constructor stub
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getDescription() {
		return description;
	}
	public void setDescription(String description) {
		this.description = description;
	}
	public List<Levelcomplete> getCombinationlevels() {
		return combinationlevels;
	}
	public void setCombinationlevels(List<Levelcomplete> combinationlevels) {
		this.combinationlevels = combinationlevels;
	}
	
	

}
